import React from "react"
import Header from "../components/Header";

function Contact() {
  return (<>
    <div>
      <Header index="2" />
    </div>
    
    <div className="container">
        <h1>My Blogs</h1>
        <p>This page is still in the works.<br /><br /> Stay Tuned!</p>
    </div>

</>);
}

export default Contact;
